import React, { useState } from 'react';
import { NavLink, Link } from 'react-router-dom'; // Importez NavLink et Link pour la navigation
import TitleSubtitle from '../Components/TitleSubtitle.jsx';
import CopyrightText from '../Components/CopyrightText.jsx';
import Logo from '../Components/Logo.jsx'; // Importer le composant Logo

function Popup({ onClose }) {
  return (
    <div className="fixed inset-0 flex items-center justify-center z-50">
      <div className="absolute inset-0 bg-gray-800 opacity-50"></div> {/* Fond gris en arrière-plan */}
      <div className="bg-white p-8 rounded shadow-lg relative z-10"> {/* Boîte de dialogue en premier plan */}
        <button className="close-btn absolute top-0 right-0 m-4" onClick={onClose}>
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 text-gray-500" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" />
          </svg>
        </button>
        <h2 className="text-2xl font-bold mb-4">Encaissement réussi</h2>
        <p>MR TETCHI a payé</p>
        <h1>10 000 FCFA</h1>
        <h5>et a le reçu N°</h5>
        <h1>2 3 7 6</h1>
      </div>
    </div>
  );
}

function EncaisserPage() {
  const [showPopup, setShowPopup] = useState(false);

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  const handleEncaisserClick = () => {
    // Logique pour effectuer l'encaissement

    // Afficher le pop-up
    setShowPopup(true);
  };

  return (
    <div className="encaisser-page flex flex-col items-center justify-center h-screen">
      {/* Navbar */}
      <nav className="bg-gray-800 py-4 px-8 flex justify-between items-center mb-4 w-full">
        <Link to="/" className="text-white text-xl">Goblo</Link>
        <div className="hidden sm:flex items-center space-x-4">
          <NavLink to="/enrollment" activeClassName="font-semibold" className="text-white mx-2">Enrollment</NavLink>
          <NavLink to="/reports" activeClassName="font-semibold" className="text-white mx-2">Reports</NavLink>
          <NavLink to="/accounts" activeClassName="font-semibold" className="text-white mx-2">Accounts</NavLink>
          <NavLink to="/control" activeClassName="font-semibold" className="text-white mx-2">Control</NavLink>
          <NavLink to="/withdraw" activeClassName="font-semibold" className="text-white mx-2">Withdraw</NavLink>
          <NavLink to="/encaisser" activeClassName="font-semibold" className="text-white mx-2">Encaisser</NavLink>
        </div>
        <button className="text-white block sm:hidden" onClick={() => setShowNav(!showNav)}>
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16m-7 6h7" />
          </svg>
        </button>
      </nav>

      {/* Logo */}
      <div className="mb-4">
        <Logo />
      </div>

      {/* Titre et sous-titre centrés */}
      <div className="text-center mb-4">
        <TitleSubtitle title="Encaisser" subtitle="les contribuables" />
      </div>

      {/* Champ de saisie pour le matricule */}
      <div className="mb-4">
        <input type="text" placeholder="Matricule" className="matricule-input border border-gray-300 rounded-md py-2 px-4" />
      </div>

      {/* Bouton "Encaisser" */}
      <div className="mb-4">
        <button className="bout bg-black text-white font-bold py-2 px-4 rounded" onClick={handleEncaisserClick}>Encaisser</button>
      </div>

      {/* Pop-up */}
      {showPopup && <Popup onClose={handleClosePopup} />}

      {/* Composant pour le droit d'auteur */}
      <div className="mt-auto">
        <CopyrightText />
      </div>
    </div>
  );
}

export default EncaisserPage;
